Compounds represented by the general formula
  in which R 1  represents-CH 3 , -CH 2 CH 3  or -(CH 2 ) 2  CH 3 ;
 R 2  represents -CONHR 4 , -F, -Cl, -Br, -I, -CF 3 , -N0 2 , -NH 2 , -CH 3 , -OCH 3  or-NHCOCH 3 , and R 3  represents -CONHR 4 , -H, -CH 3  or -OCH 3 , with the proviso that at least one of R 2  and R 3  represents -CONHR 4 ; and R 4  represents H, or -CH 3 , -CH 2 CH 3 , -(CH 2 ) 2 CH 3 , -(CH 2 ) 3 CH 3  or - CH 2 CH(CH 3 ) 2 , each optionally substituted with hydroxyl, amine and/or amide functions; and acid addition salts thereof have antitumour properties.
